      <div style={style}>
        <h2>No Limits for Deaf Children (Documentary)</h2>
        <h2>Blue Hour (Short Film)</h2>
        <h2>All Summer in a Day (Short Film)</h2>
        <h2>Killer Kids (A&E)</h2>
        <h2>Night Watch (A&E)</h2>
        <h2>Pitbulls and Parolles (Animal Planet)</h2>
        <h2>Curse of Oak Island (History Channel)</h2>
        <h2>Mother of All Lies (Lifetime)</h2>
      </div>
    );
  }
}
